        <div id=""Intro"">
            JOKER SITE
        </div>
        <p id=""info"">История психа | ДЖОКЕР</p>
        <div id=""about"">
            Джо́кер — американский психологический триллер режиссёра Тодда Филлипса по сценарию, написанному Филлипсом совместно со Скоттом Сильвером. 
            Главную роль исполняет Хоакин Феникс. 
            Сюжет фильма представляет собой версию истории происхождения суперзлодея Джокера, одного из ключевых антагонистов Бэтмена в комиксах компании DC Comics.

            Премьера состоялась 31 августа 2019 года на 76-м Венецианском кинофестивале, где картина удостоилась главного приза — «Золотого льва». 
            Фильм вышел 4 октября 2019 года, а в России — 3 октября. 
            Фильм собрал в мировом прокате более одного миллиарда долларов, что позволило ему занять седьмую строчку в списке самых кассовых фильмов 2019 года и стать самым кассовым в истории среди картин категории R, а также первым фильмом с данным рейтингом, чьи сборы превысили миллиар");
                WriteLiteral(@"д долларов.
            На 92-й церемонии вручения премии «Оскар» фильм «Джокер» был номинирован в одиннадцати категориях, включая лучший фильм и лучшую режиссуру, одержав победу в двух номинациях: Хоакин Феникс получил премию «Оскар» за лучшую мужскую роль, а композитор фильма Хильдур Гуднадоуттир — за лучшую музыку к фильму. Феникс и Гуднадоуттир также получили «Золотой глобус» и BAFTA. 
            Кроме того, исполнитель главной роли также был удостоен награды Американской Гильдии киноактёров за лучшую мужскую роль.
